import 'bootstrap/dist/css/bootstrap.min.css';

import React from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import './index.css'; 

const Nav_bar = () => {
    return(
        <Navbar expand='lg'>
            <Navbar.Brand>Ezeiyoke Cosmas</Navbar.Brand>
            <Navbar.Toggle/>
            <Navbar.Collapse>

                <Nav className='me-auto'>
                    <Nav.Link href='#'>Home</Nav.Link>
                    <Nav.Link href='#'>Instuctions</Nav.Link>

                </Nav>
            </Navbar.Collapse>
            </Navbar>
        
    );
}


const Bodycontent = () => {
    return(
        <div className='container question-cont'>
            <div className='row question-row'>
                <div className='col-lg-4'>
                    <div><h3>Total Time</h3></div>
                    <div className='pe'></div>
                </div>
                <div className='question'>
                    <h3>The best database storage</h3>
                </div>

                <div className='options1'><p>rds</p></div>
                <div className='options1'><p>dyamno</p></div>
                <div className='options1'><p>auro</p></div>
                <div className='options1'><p>athen</p></div>
            </div>

        </div>
    );
}


function App() {
    return(

        <div className='app'>

            <Nav_bar />
            <Bodycontent/>

        </div>

    )


}

export default App
